// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

import "./VaultBase.sol";
import "../../interfaces/IUniswapV2Router02.sol";


pragma experimental ABIEncoderV2;

contract LimitOrderVault is VaultBase {
    constructor(Settings _settings, uint256 _maxTokens) public ERC721("test vault", "tv") {
        require(_maxTokens > 1, "CornFi Vault: Max Tokens Cannot be Less Than 1");
        settings = _settings;
        maxTokens = _maxTokens;


        // Mint a blank strategy to this contract.
        // When referencing 'tokenAmounts[_tokenId][_token]',
        // use '0' for '_tokenId' to keep track of amounts
        // deposited accross all users. 
        orders.push();
        strategies.push();
        _mint(address(this), tokenCounter);
        tokenOpenOrderIds.push();
        tokenCounter++;
    }


    /*
    * _tokens[0] = {required} from token
    * _tokens[1] = {required} to token
    *
    * _amounts[0] = {required} starting amount
    * _amounts[1] = {required} sell price (1) (token[1] / token[0]) * 10e8
    * _amounts[2] = {optional} sell price (2) (token[1] / token[0]) * 10e8
    * _amounts[3] = {optional} sell price (3) (token[1] / token[0]) * 10e8
    * _amounts[4] = {optional} sell price (3) (token[1] / token[0]) * 10e8
    *
    * _times[0] = {required} 0 (Feature Not Used)
    */
    function createTrade(address _from, address[] memory _tokens, uint256[] memory _amounts, uint[] memory _times) public onlyController {
        require(tokenCounter < maxTokens, "CornFi Vault Base: Max Tokens Reached");

        require(_amounts.length >= 2);
        require(_amounts.length <= 5, "CornFi Vault Base: Max Orders Exceeded");

        require(_amounts[0].div(_amounts.length.sub(1)) >= settings.minimumDeposit(_tokens[0]), "CornFi Limit Order Vault: Minimum Deposit Not Met");

        // Create the strategy
        _setStrategy(_tokens, _amounts, _times);

        // Transfer deposit amount from user
        IERC20(_tokens[0]).transferFrom(_from, address(this), _amounts[0]);

        IStrategy strat = settings.strategy(_tokens[0]);

        // Deposit fee
        uint256 depositFee = strat.depositFee(_amounts[0]);
        IERC20(_tokens[0]).transfer(settings.Fees(), depositFee);

        // Adjust token amount to include fee
        uint256 amountInWithFee = _amounts[0].sub(depositFee);
        tokenAmounts[tokenCounter][_tokens[0]] = amountInWithFee;

        IERC20(_tokens[0]).approve(address(strat), amountInWithFee);    //
        strat.deposit(address(this), _tokens[0], amountInWithFee);      //

        // Calculate amount in for the orders.
        // The number of sell prices determines how many orders to create.
        // The amount in for the sell orders is the total amount deposited
        // divided by the number of sell prices. Each sell order will have
        // the same amount in.
        //
        // Example:
        //      - amount in: 100 USDC
        //      - to token: WMATIC
        //      - sell price 1: 0.9 WMATIC / 1 USDC
        //      - sell price 2: 0.7 WMATIC / 1 USDC
        //      - sell price 3: 0.5 WMATIC / 1 USDC
        //      - sell price 4: 0.4 WMATIC / 1 USDC
        //
        //  * amount out = amount in / sell price *
        //
        //  Sell order 1: 25 USDC --> 27.77 WMATIC
        //  Sell order 2: 25 USDC --> 35.71 WMATIC
        //  Sell order 3: 25 USDC --> 50 WMATIC
        //  Sell order 4: 25 USDC --> 62.5 WMATIC
        uint256 orderAmountIn = amountInWithFee.div(_amounts.length.sub(1));

        uint256[] memory amounts = _amounts;
        address[] memory tokens = _tokens;

        for(uint i = 1; i < amounts.length; i++) {
            // Create initial order
            _createOrder(tokenCounter, 0, [tokens[0], tokens[1]], [orderAmountIn, _getAmountOut(tokens[0], tokens[1], orderAmountIn, amounts[i]), 0], _times);
        }

        _safeMint(_from, tokenCounter++);
    }


    function fillOrder(address _from, uint256 _orderId, IUniswapV2Router02 _router, address[] memory _path) public onlyController {
        require(settings.router(address(_router)));
        Order memory order = orders[_orderId];

        uint256 lastElement = _path.length.sub(1);

        require(order.timestamp == 0, "CornFi Stop Loss Vault: Order is Inactive");
        require(
            _path[0] == order.tokens[0] &&
            _path[lastElement] == order.tokens[1], 
            "CornFi Limit Order Vault: Invalid Path"
        );

        uint256 amountOut = _router.getAmountsOut(order.amounts[0], _path)[lastElement];
        uint256 minAmountOut = settings.slippage(amountOut);

        require(minAmountOut >= order.amounts[1], "CornFi Limit Order Vault: Insufficent Output Amount");

        settings.strategy(order.tokens[0]).withdraw(address(this), order.tokens[0], order.amounts[0]);      //

        IERC20(order.tokens[0]).approve(address(_router), order.amounts[0]);
        uint256 swapAmountOut = _router.swapExactTokensForTokens(
            order.amounts[0], 
            minAmountOut, 
            _path, 
            address(this), 
            now.add(60)
        )[lastElement];

        require(swapAmountOut >= order.amounts[1], "CornFi Limit Order Vault: Insufficent Output Amount");

        IStrategy strat = settings.strategy(order.tokens[1]);

        uint256 fillerFee = strat.fillerFee(order.amounts[1]); 
        IERC20(order.tokens[1]).transfer(_from, fillerFee);


        uint256 txFee = strat.txFee(order.amounts[1]);
        uint256 remainder = swapAmountOut.sub(order.amounts[1]);
        IERC20(order.tokens[1]).transfer(settings.Fees(), remainder.add(txFee));
        orders[_orderId].amounts[1] = order.amounts[1].sub(fillerFee).sub(txFee);

        IERC20(order.tokens[1]).approve(address(strat), orders[order.orderId].amounts[1]);    //
        strat.deposit(address(this), order.tokens[1], orders[order.orderId].amounts[1]);    //

        // Close order, transfer tokens between caller and this contract
        _closeOrderHelper(order.orderId);
    }


    function withdraw(address _from, uint256 _tokenId) public onlyController {
        require(ownerOf(_tokenId) == _from, "CornFi Vault Base: Caller is Not the Token Owner");
        Strategy memory strat = strategies[_tokenId];
        for(uint i = 0; i < strat.tokens.length; i++) {
            if(tokenAmounts[_tokenId][strat.tokens[i]] > 0) {
                settings.strategy(strat.tokens[i]).withdraw(_from, strat.tokens[i], tokenAmounts[_tokenId][strat.tokens[i]]);      //
                //IERC20(strat.tokens[i]).transfer(_from, tokenAmounts[_tokenId][strat.tokens[i]]);
                tokenAmounts[_tokenId][strat.tokens[i]] = 0;
            }
        }
        uint256[] memory orderIds = tokenOpenOrderIds[_tokenId];
        for(uint j = 0; j < orderIds.length; j++) {
            _removeOpenOrder(orderIds[j]);
            orders[orderIds[j]].timestamp = 1;
        }
        delete tokenOpenOrderIds[_tokenId];
        _burn(_tokenId);
    }


    function _closeOrderHelper(uint256 _orderId) internal {
        Order memory order = orders[_orderId];

        // Adjust token amounts
        tokenAmounts[order.tokenId][order.tokens[1]] = tokenAmounts[order.tokenId][order.tokens[1]].add(order.amounts[1]);

        // Adjust token amounts
        tokenAmounts[order.tokenId][order.tokens[0]] = tokenAmounts[order.tokenId][order.tokens[0]].sub(order.amounts[0]);

        // Close trade
        orders[_orderId].timestamp = block.timestamp;

        // Remove open order
        _removeOrder(true, _orderId);
    }
}
